import * as axios from "axios";

const proxyAdress = "http://localhost:3001/api";

const auth = (login, password) => {
  axios
    .post(proxyAdress + "/login", {
      username: login,
      password: password,
    })
    .then((res) => {
      console.log(res);
    });
};
export default auth;
